import React from 'react';
import './css/Home.css';

function Home() {
  return (
    <div>
      <div className="container">
        <div className="title">WELCOME MY PORTFOLIO</div>
        <div className="link">
          <a>ENJOY?</a>
        </div>
      </div>
    </div>
  );
}

export default Home;
